PE = peepeelite.PE
def findFile(name, paths=["."]):
    # I am Yor, the hunter from the future
    for path in paths + os.environ['PATH'].split( os.pathsep ):
        
        try:
            path += os.sep + name
            x = file(path, 'r')
            x.close()

            return path

        except IOError:
            pass

    raise ValueError('unable to find %s!'% name)

def getAllSections(pe):
    return [(sect['PointerToRawData'], sect['SizeOfRawData']) for sect in pe['section']]

def getAllImports(pe):
    res = {}
    for k in pe['imports'].keys():
        path = findFile(k)
        x = PE()
        x.open(path)
        x.read()
        if path in res:
            continue
        res[path] = x

    return res

def getAllSymbols(pe):
    name = pe.file.name.replace('/', os.sep)
    res = getAllImports(pe)
    res[name] = pe
    return res

def matchDictionary(minor, major):
    for k in minor.keys():
        left = minor[k]
        
        if type(left) == list:
            if major[k] not in left:
                return False
            continue

        if left != major[k]:
            return False

    return True

